<html>

<head>
    <meta charset="utf-8">
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js"></script>
    <script src="papaparse.min.js"></script>
    <script src="tippy.js"></script>
    <link rel="stylesheet" type="text/css" href="stile.css">

    <script>
        var results = {};
        Papa.parse("./data.csv", {
            download: true,
            header: true,
            complete: (x) => {
                $.extend( true, results, x );
            }
        });

        var spalvos = {
            "0": 'white',
            "1": 'red',
            "2": 'blue',
            "3": 'yellow',
            "4": 'green',
            "5": 'purple',
        };

        var tippy_html_list = {};

        function setStuff() {
            for (i in results.data) {
                $('#_' + results.data[i]['Sklypo Nr.']).css('fill', spalvos[results.data[i].Spalva]);
                var temp = document.getElementById('_' + results.data[i]['Sklypo Nr.']);
                document.getElementById('_' + results.data[i]['Sklypo Nr.']).setAttribute("stroke-width", 1);
                document.getElementById('_' + results.data[i]['Sklypo Nr.']).setAttribute("stroke", '#000');

                //Tooltips
                var tippy_text = document.createElement('p');
                tippy_text.innerHTML = 'Sklypo Nr: ' + results.data[i]['Sklypo Nr.'] + '</br>' + results.data[i]['Adresas'] + '</br></br>Infrastruktūros mokestis:</br>' + results.data[i]['Tekstas_1'] + '</br></br>Informuota:</br>' + results.data[i]['Tekstas_2'];
                tippy(temp, {
                    html: tippy_text,
                    animateFill: false,
                    followCursor: true
                })
            };
        };

        $(document).ready(function () {
            setTimeout(setStuff, 10);
        });

    </script>
</head>
